import * as React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import './InnerStyles/ProfileSection.css'

export default function ProfileSection() {
    
const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));
    const userInfo = {
        name:'Nischal Shakya',
        dob:'01/04/2002',
        address:'Gwarko,Lalitpur',
        grade:'10',
        phone:'85153150551',
        house:'Matterhorn/Yellow',
        fatherName : 'Nabin Shakya',
        fathersNumber : '8564684165165',
        motherName : 'Arina Shakya',
        fathersNumber : '8564684165165',
    }
    return (
    <div className='profile-section'>
        <div className='prf-image'>
        </div>
        <Box sx={{ flexGrow: 2 }}>
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <Item>Name :Nischal Shakya</Item>
                </Grid>
                <Grid item xs={4}>
                    <Item>xs=4</Item>
                </Grid>
                <Grid item xs={8}>
                    <Item>xs=8</Item>
                </Grid>
            </Grid>
        </Box>
    </div>
    )
}
